import { ModelAnalyticsEvent } from './model-analytics-event';
export class ModelClickEvent extends ModelAnalyticsEvent {
    constructor(analyticsSetup, modelRangeName, model) {
        super(analyticsSetup, modelRangeName);
        this.context.eventAction = 'PAGHomeNav_Model_Click';
        this.populateComponentClickFromLink(model);
    }
    populateComponentClickFromLink(model) {
        this.componentClick.clickElementId = model.PhraseId;
        this.componentClick.clickElementName = undefined;
        this.componentClick.clickElementType = 'link';
        this.componentClick.targetUrl = model.Link;
    }
    event() {
        const componentClick = this.componentClick;
        return Object.assign(Object.assign({}, super.event()), { componentClick });
    }
}
